followed through, turn off the machine and unplug it. "},"elements":[],"widgetType":"text-editor"},{"id":"f0311c7","elType":"widget","settings":{"title":"7.	Wash After Every Use","header_size":"h3"},"elements":[],"widgetType":"heading"},{"id":"a2b9689","elType":"widget","settings":{"editor":"Separate the components and clean with warm water. "},"elements":[],"widgetType":"text-editor"},{"id":"b0bcc3a","elType":"widget","settings":{"editor":"Air dry everything and put it away to store. "},"elements":[],"widgetType":"text-editor"},{"id":"c60bc88","elType":"widget","settings":{"title":"Benefits and Advantages ","_margin":{"unit":"px","top":"30","right":"0","bottom":"0","left":"0","isLinked":false}},"elements":[],"widgetType":"heading"},{"id":"a293942","elType":"widget","settings":{"image":{"url":"","id":"","size":""},"title_text":"Quick Cure of the Respiratory Problems ","description_text":"Brings medication directly into the lungs, which helps to obtain faster effects against asthma, bronchitis, congestion of the sinuses, allergies, and other breathing complications. ","text_align":"left","title_bottom_space":{"unit":"px","size":0,"sizes":[]},"custom_css":"selector h3{
